        <div className="container-fluid main_container">
      <div className="row">
        <aside className="col-md-3 ms-"><Sidebar /></aside>
        <div className="col-md-7 mt-3">
        <div className="col-md-3 mb-4">
          <div className='row'>
        {trainingData.map((training, index) => (
            <div className="card" >
                <Link to={`/detail/`+training.course.id}><img src={training.course.featured_img} className="card-img-top" width={300} height={300} alt={training.course.title} /></Link>
